pragma solidity ^0.8.4;

import {IResultController} from "./IResultController.sol";

abstract contract baseResultController is IResultController {
  bool private _hasResult;
  uint256 public result;
  bytes32[] public optionNames;

  constructor () {
    _hasResult = false;
  }

  function setResult (uint256 r) internal {
    require(!_hasResult, "Already has result.");
    _hasResult = true;
    result = r;
    emit resultGenerated (address(this), result);
  }

  function setOptions (bytes32[] memory options) internal {
    optionNames = options;
  }

  function addOption (bytes32 optionName) internal {
    optionNames.push(optionName);
  }

  function hasResult () external view override returns (bool)  {
    return _hasResult;
  }

  function getResult () external view override returns (uint256)
  {
    return result;
  }

  function getOptionsCount () external view override returns (uint256) {
    return _getOptionsCount();
  }

  function getOptionName (uint256 index) external view override returns (bytes32) {
    return optionNames[index];
  }

  function _getOptionsCount () public view returns (uint256) {
    return optionNames.length;
  }

  function getGame () external view returns (bytes32) {
    return _getGame();
  }

  function _getGame () internal view virtual returns (bytes32);
}","keccak256":"0x78d45de31de5941263a6661350870a6dfdba69995a30eba089fa70c4b883d403","license":"MIT"},"contracts/notQuiteRandom/NotQuiteRandom.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract NotQuiteRandom {
    function getRandomNumber()
        public
        view
        returns (uint256 notQuiteRandomNumber)
    {
        notQuiteRandomNumber = uint256(blockhash(block.number - 1));
    }

    function getRandomNumberFromInterval(uint256 limit) public view returns (uint256 heads) {
        return getRandomNumber() % limit;
    }
}","keccak256":"0x90844e52985c462cbc599935befabfcb59bec62758b682c060a38cd2f1985fbe","license":"GPL-3.0"},"contracts/notQuiteRandom/coinFlip.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import {baseResultController} from "../baseResultController.sol";
import {NotQuiteRandom} from "./NotQuiteRandom.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

import "hardhat/console.sol";

contract notQuiteRandomCoinFlip is baseResultController, NotQuiteRandom, Ownable {

  constructor (address owner) {
    addOption(bytes32(abi.encodePacked("Heads")));
    addOption(bytes32(abi.encodePacked("Tails")));
    transferOwnership(owner);
  }

  function generateResult () external onlyOwner {
    setResult(getRandomNumberFromInterval(2));
  }

  function _getGame () internal view override returns (bytes32)
  {
    return bytes32(abi.encodePacked("Coin Flip"));
  }

